import React from 'react';
import './Header.css';
import Button from '../Button/Button.jsx'

const Header = () => {
  return (
    <div className='Header'>
      <nav className='navbuttons'>
        <button cl>Home</button>
        <button>About Us</button>
        <button>Services</button>
      </nav>
      <Button/>
    </div>
  )
}

export default Header
